package com.cinyi.crawlers.xywy.entity;

public class MedicationParameter {

	private String name;
	private String sccj;
	private String pzwh;
	
	public MedicationParameter(String name, String sccj, String pzwh) {
		super();
		this.name = name;
		this.sccj = sccj;
		this.pzwh = pzwh;
	}
	
	public MedicationParameter() {
		super();
		// TODO Auto-generated constructor stub
	}

	public String getName() {
		return name;
	}
	public void setName(String name) {
		this.name = name;
	}
	public String getSccj() {
		return sccj;
	}
	public void setSccj(String sccj) {
		this.sccj = sccj;
	}
	public String getPzwh() {
		return pzwh;
	}
	public void setPzwh(String pzwh) {
		this.pzwh = pzwh;
	}
}
